import './Borrow.css';

function Borrow(){
    const curr_date = new Date(2022, 4, 13);
    const Name = 'Aamir';
    const Amount = '1000';
    const ssn = '12345'

    return( 
    <div>
        <div className='box'>
            <div className='date_box'>13th april</div>
        </div>        
        <div className='box'>{Name}</div>
        <div className='box'>${Amount} </div>
        <div className='box'>{ssn}</div>
        <div className='box'>Term: </div>
        <div className='box'>Credit Score: </div>
        
    </div>
    );
}

export default Borrow;
